define('text!views/history.html',[],function () { return '<div id="period-panel" class="period-panel-wrapper navbar-fixed-top" data-bind="with: profile" style="top: 50px; background-color: #5cb85c">\r\n    <ul class="list-group list-inline text-center" data-bind="foreach: history.periods" style="margin: 0">\r\n        <li style="cursor: pointer"\r\n            class="list-group-item {{id === $root.activePeriodId() ? \'list-group-item-info\' : \'\'}}"\r\n            data-bind="click: $root.changePeriod">\r\n            <h5 class="list-group-item-heading">{{startDate | date: "MM/YYYY"}} - {{endDate | date:\r\n                "MM/YYYY"}}</h5>\r\n\r\n            <p class="list-group-item-text">{{title}}</p>\r\n        </li>\r\n    </ul>\r\n</div>\r\n\r\n<div id="history-page-host" class="page-host" data-bind="with: profile" style="top: 133px">\r\n    <div class="col-md-12" style="padding: 0; background-color: #4FD2E4">\r\n        <div id="timeline-wrapper">\r\n            <ul class="timeline" data-bind="foreach: history.details">\r\n                <li id="timeline-id-{{id}}" class="time-label">\r\n                    <span class="bg-light-blue">{{endDate | date: "MMM YYYY"}}</span>\r\n                </li>\r\n                <!-- ko foreach: contents -->\r\n                <li>\r\n                    <i class="fa fa-user bg-blue"></i>\r\n\r\n                    <div class="timeline-item">\r\n                        <span class="time"><i class="fa fa-clock-o"></i> {{startDate | date: "MM/DD/YYYY"}}</span>\r\n\r\n                        <h3 class="timeline-header">{{title}}</h3>\r\n\r\n                        <div class="timeline-body">\r\n                            <div data-bind="html: description"></div>\r\n                            <slide-show params="items: screenshots, options: slideshowOptions"></slide-show>\r\n                        </div>\r\n                    </div>\r\n                </li>\r\n\r\n                <!-- /ko -->\r\n            </ul>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<section id="myModal" class="modal hide fade">\r\n    <div id="printThis">\r\n        <div class="modal-body">\r\n            <img src="//placehold.it/200x150/DD2222" id="print-img">\r\n        </div>\r\n    </div>\r\n</section>\r\n\r\n\r\n';});


define('text!views/home.html',[],function () { return '<div class="page-host">\r\n    <div class="row well">\r\n        <div class="col-md-7">\r\n            <div class="panel panel-default">\r\n                <div class="panel-body" data-bind="with: profile">\r\n                    <div class="row">\r\n                        <div class="col-xs-12 col-sm-8">\r\n                            <h2>{{firstName + " " + middleName + " " + lastName}}</h2>\r\n\r\n                            <p><strong>Birthday: </strong> 21/02/1988 </p>\r\n\r\n                            <p><strong>Address: </strong> 482/12/19 Le Quang Dinh, Ward 11, District Binh Thanh, Vietnam\r\n                            </p>\r\n\r\n                            <p><strong>Phone: </strong> 0902.428.521 </p>\r\n\r\n                            <p><strong>Email: </strong> <a href="mailto:lovedota21@gmail.com">lovedota21@gmail.com</a>\r\n                            </p>\r\n\r\n                            <p><strong>Hobbies: </strong> Kicking Shuttle Cock, BreakDance, Football</p>\r\n\r\n                            <p><strong>Education: </strong> 20/07/2010: Graduated Vanlang University at Department of\r\n                                Software Engineer.</p>\r\n\r\n                            <p><strong>Community Involvement : </strong></p>\r\n                            <ul>\r\n                                <li>Volunteer for hard project and concentration required.</li>\r\n                                <li>Looking for the best performance of coding and art of programming.</li>\r\n                            </ul>\r\n                            <p><strong>Personality: </strong></p>\r\n                            <ul>\r\n                                <li>Always looking forward to the best way, so always debating.</li>\r\n                                <li>Love the truth.</li>\r\n                                <li>Interested at discussing in Programming Forum and Learning new skills.</li>\r\n                            </ul>\r\n                        </div>\r\n                        <!--/col-->\r\n                        <div class="col-xs-6 col-sm-3 text-center">\r\n                            <img data-bind="attr: {src: photoUrl}" alt=""\r\n                                 class="center-block img-circle img-responsive">\r\n                        </div>\r\n                        <!--/col-->\r\n                    </div>\r\n                    <!--/row-->\r\n                </div>\r\n                <!--/panel-body-->\r\n            </div>\r\n            <!--/panel-->\r\n\r\n\r\n        </div>\r\n\r\n        <div class="col-md-5">\r\n            <div class="panel panel-default">\r\n                <div class="panel-body" data-bind="with: profile">\r\n                    <div class="row">\r\n                        <div class="col-xs-12">\r\n                            <p><strong>CAREER OBJECTIVE</strong></p>\r\n                            <ul>\r\n                                <li>Developer</li>\r\n                                <li>Web Developer</li>\r\n                                <li>Web Front-End Developer</li>\r\n                                <li>Team Leader</li>\r\n                                <li>Technique Developer</li>\r\n                            </ul>\r\n                        </div>\r\n                        <div class="col-xs-12">\r\n                            <p><strong>SKILLS</strong></p>\r\n\r\n                            <div class="col-md-5">\r\n                                <ul data-bind="foreach: skills.frontend">\r\n                                    <li><span class="label label-info tags">{{$data}}</span></li>\r\n                                </ul>\r\n                            </div>\r\n                            <div class="col-md-5">\r\n                                <ul data-bind="foreach: skills.backend">\r\n                                    <li><span class="label label-info tags">{{$data}}</span></li>\r\n                                </ul>\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                    <!--/row-->\r\n                </div>\r\n                <!--/panel-body-->\r\n            </div>\r\n            <!--/panel-->\r\n\r\n\r\n        </div>\r\n    </div>\r\n</div>\r\n';});


